import { useState, useEffect } from "react";
import LaunchCard from "./LaunchCards";

function LaunchPhotos() {
    const [launchPhotos, setLaunchPhotos]=useState([])
    useEffect(() => {
        fetch("https://api.spacexdata.com/v5/launches")
        .then((response)=> response.json())
        .then((data) => setLaunchPhotos(data))
    }, [])
    return (
      <div className="Block">
        <h2>Launches</h2>
        <div>
            {launchPhotos.filter((item)=> item.links.flickr.original.length>0).map((launchPhoto)=> <LaunchCard launchItem={launchPhoto}/>)}
        </div>
      </div>
    );
  }

  export default LaunchPhotos;
